import React from 'react';

export default function ScannerPage() {
	return (
		<div className="scanner-page" style={{padding: 12}}>
			<h3>Scanner</h3>
			<p style={{color:'#666'}}>Scanner page placeholder. Scans across symbols and shows EMA26/EMA200 crosses here.</p>
		</div>
	);
}
